#include <numeric>

float mean_absolute_deviation(vector<float> numbers) {
    float sum = std::accumulate(numbers.begin(), numbers.end(), 0.0);
    float mean = sum / numbers.size();
    float sum_abs_deviations = std::accumulate(numbers.begin(), numbers.end(), 0.0,
        [mean](float acc, float num) { return acc + abs(num - mean); });
    return sum_abs_deviations / numbers.size();
}

