#include<stdio.h>
#include<vector>
#include<string>
using namespace std;

vector<int> parse_nested_parens(string paren_string){
    vector<int> result;
    string group = "";
    for (char c : paren_string) {
        if (c ==' ') {  // Changed '' to'' to fix the compile bug
            if (!group.empty()) {
                int max_depth = 0;
                int current_depth = 0;
                for (char ch : group) {
                    if (ch == '(') {
                        current_depth += 1;
                        max_depth = max(max_depth, current_depth);
                    } else if (ch == ')') {
                        current_depth -= 1;
                    }
                }
                result.push_back(max_depth);
                group = "";
            }
        } else {
            group += c;
        }
    }
    // Process the last group
    if (!group.empty()) {
        int max_depth = 0;
        int current_depth = 0;
        for (char ch : group) {
            if (ch == '(') {
                current_depth += 1;
                max_depth = max(max_depth, current_depth);
            } else if (ch == ')') {
                current_depth -= 1;
            }
        }
        result.push_back(max_depth);
    }
    return result;
}

