string remove_vowels(string text){
    string vowels = "aeiouAEIOU";
    string result = "";
    for (char c : text) {
        if (vowels.find(c) == string::npos) {
            result += c;
        }
    }
    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (remove_vowels("") == "");
