#include<stdio.h>
#include<string>
#include<vector>
using namespace std;
bool correct_bracketing(string brackets){
    vector<char> stack;
    for (char bracket : brackets) {
        if (bracket == '<') {
            stack.push_back(bracket);
        } else if (bracket == '>') {
            if (stack.empty()) {
                return false;
            }
            stack.pop_back();
        }
    }
    return stack.empty();
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (correct_bracketing("<>"));
    assert (correct_bracketing("<<><>>"));
