#include <functional>
#include <cmath>
#include <cstdlib>
#include <queue>
#include <bits/stdc++.h>
using namespace std;

bool is_prime(int n) {
    if (n <= 1) {
        return false;
    }
    if (n == 2) {
        return true;
    }
    if (n % 2 == 0) {
        return false;
    }
    int max_divisor = sqrt(n) + 1;
    for (int d = 3; d <= max_divisor; d += 2) {
        if (n % d == 0) {
            return false;
        }
    }
    return true;
}

bool prime_length(string str) {
    return is_prime(str.length());
}

