int starts_one_ends(int n) {
    // Calculate the total number of n-digit numbers that start with 1
    long long numbers_start_with_1 = pow(10, n - 1);

    // Calculate the total number of n-digit numbers that end with 1
    long long numbers_end_with_1 = pow(10, n - 1);

    // Calculate the total number of n-digit numbers that start and end with 1
    long long numbers_start_and_end_with_1 = pow(10, n - 2);

    // Return the count of numbers that start or end with 1
    return numbers_start_with_1 + numbers_end_with_1 - numbers_start_and_end_with_1;
}


