string anti_shuffle(string s) {
    string result = "";
    string word = "";
    for (char c : s) {
        if (c ==' ') {  // Changed '' to''
            // Sort the word while keeping non-alphabetic characters first
            std::stable_sort(word.begin(), word.end(), [](char a, char b) {
                bool a_is_alpha = std::isalpha(a);
                bool b_is_alpha = std::isalpha(b);
                if (a_is_alpha!= b_is_alpha) {
                    return a_is_alpha < b_is_alpha;
                }
                return std::tolower(a) < std::tolower(b);
            });
            result += word + " ";
            word = "";
        } else {
            word += c;
        }
    }
    // Sort the last word
    std::stable_sort(word.begin(), word.end(), [](char a, char b) {
        bool a_is_alpha = std::isalpha(a);
        bool b_is_alpha = std::isalpha(b);
        if (a_is_alpha!= b_is_alpha) {
            return a_is_alpha < b_is_alpha;
        }
        return std::tolower(a) < std::tolower(b);
    });
    result += word;
    return result;
}

