// Function to sort a string while preserving the case of non-alphabetical characters
std::string sortString(const std::string& str) {
    std::string sortedStr = str;
    std::sort(sortedStr.begin(), sortedStr.end(), [](char a, char b) {
        if (!std::isalpha(a) && std::isalpha(b)) return true;
        if (std::isalpha(a) &&!std::isalpha(b)) return false;
        return std::tolower(a) < std::tolower(b);
    });
    return sortedStr;
