// Function to check if a number is prime
int is_prime(int n) {
    if (n < 2) return 0;
    for (int i = 2; i * i <= n; i++) {
        if (n % i == 0) return 0;
    }
    return 1;
}

// Function to calculate sum of digits of a number
int sum_of_digits(int n) {
    int sum = 0;
    while (n > 0) {
        sum += n % 10;
        n /= 10;
    }
    return sum;
}

// Main function to find the largest prime value and return the sum of its digits
int skjkasdkd(vector<int> lst) {
    int max_prime = 0;
    for (int num : lst) {
        if (is_prime(num) && num > max_prime) {
            max_prime = num;
        }
    }

    return sum_of_digits(max_prime);
}

