using namespace std;

bool move_one_ball(vector<int> arr) {
    if (arr.empty()) {
        return true;
    }
    vector<int> sorted_arr = arr;
    sort(sorted_arr.begin(), sorted_arr.end());
    int n = arr.size();
    for (int i = 0; i < n; i++) {
        bool match = true;
        for (int j = 0; j < n; j++) {
            if (arr[(i + j) % n]!= sorted_arr[j]) {
                match = false;
                break;
            }
        }
        if (match) {
            return true;
        }
    }
    return false;
}

