#include <queue>
#include <bits/stdc++.h>
using namespace std;

#include <stack>
#include <string>
#include <vector>

bool is_balanced(const std::string& s) {
    std::stack<char> stack;
    for (char c : s) {
        if (c == '(') {
            stack.push(c);
        } else if (c == ')') {
            if (stack.empty()) {
                return false;
            }
            stack.pop();
        }
    }
    return stack.empty();
}

string match_parens(std::vector<std::string> lst) {
    for (const auto& order : {lst, std::vector<std::string>{lst[1], lst[0]}}) {
        if (is_balanced(order[0] + order[1])) {
            return "Yes";
        }
    }
    return "No";
}

#undef NDEBUG
