#include <vector>
#include <algorithm>

using namespace std;

vector<int> minPath(vector<vector<int>>& grid, int k) {
    int n = grid.size();
    vector<int> directions = {0, 1, 0, -1, 0};
    vector<int> min_path(k, INT_MAX);

    vector<int> dfs(int i, int j, int step, vector<int>& path) {
        if (step == k) {
            return path;
        }
        vector<int> min_path_found(path);
        for (int l = 0; l < 4; l++) {
            int ni = i + directions[l], nj = j + directions[l + 1];
            if (ni >= 0 && ni < n && nj >= 0 && nj < n) {
                path.push_back(grid[ni][nj]);
                vector<int> temp = dfs(ni, nj, step + 1, path);
                if (temp < min_path_found) {
                    min_path_found = temp;
                }
                path.pop_back();
            }
        }
        return min_path_found;
    }

    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            vector<int> path = {grid[i][j]};
            vector<int> temp = dfs(i, j, 1, path);
            if (temp < min_path) {
                min_path = temp;
            }
        }
    }
