using namespace std;

vector<int> dfs(vector<vector<int>>& grid, int i, int j, int path_len, vector<int>& current_path, vector<int>& min_path, vector<vector<bool>>& visited, int n, vector<vector<int>>& directions) {
    if (path_len == current_path.size()) {
        if (current_path < min_path) {
            min_path = current_path;
        }
        return min_path;
    }
    visited[i][j] = true;
    for (auto& direction : directions) {
        int ni = i + direction[0], nj = j + direction[1];
        if (0 <= ni && ni < n && 0 <= nj && nj < n &&!visited[ni][nj]) {
            current_path.push_back(grid[ni][nj]);
            dfs(grid, ni, nj, path_len, current_path, min_path, visited, n, directions);
            current_path.pop_back();
        }
    }
    visited[i][j] = false;
    return min_path;
}

vector<int> minPath(vector<vector<int>> grid, int k) {
    int n = grid.size();
    vector<vector<int>> directions = {{0, 1}, {0, -1}, {1, 0}, {-1, 0}};
    vector<int> min_path(k, INT_MAX);
    vector<vector<bool>> visited(n, vector<bool>(n, false));

    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            vector<int> current_path = {grid[i][j]};
            dfs(grid, i, j, k, current_path, min_path, visited, n, directions);
        }
    }
    return min_path;
}

