#include <cstdlib>
#include <queue>
#include <bits/stdc++.h>
using namespace std;

int prod_signs(vector<int> arr){
    if (arr.empty()) {
        return -32768;
    }
    int product = 1;
    int sum_magnitude = 0;
    for (int num : arr) {
        product *= (num >= 0)? 1 : -1;
        sum_magnitude += abs(num);
    }
    return product * sum_magnitude;
}

