    vector<int> tribonacci_sequence(n + 1, 0);
    tribonacci_sequence[0] = 1;
    if (n >= 1) {
        tribonacci_sequence[1] = 3;
    }
    for (int i = 2; i <= n; i++) {
        if (i % 2 == 0) {
            tribonacci_sequence[i] = 1 + i / 2;
