using namespace std;
vector<int> tri(int n){
    vector<int> tribonacci_sequence = {1, 3, 2};
    for (int i = 3; i <= n; i++) {
        if (i % 2 == 0) {
            tribonacci_sequence.push_back(1 + i / 2);
        } else {
            int next = tribonacci_sequence[i - 2] + tribonacci_sequence[i - 3] + tribonacci_sequence.back();
            tribonacci_sequence.push_back(next);
        }
    }
    return tribonacci_sequence;
}

