bool check_if_last_char_is_a_letter(string txt){
    if (txt.empty()) {
        return false;
    }
    char last_char = txt.back();
    return (last_char >= 'a' && last_char <= 'z') || (last_char >= 'A' && last_char <= 'Z') 
           && (txt.size() == 1 || txt.find_last_of(' ') == txt.size() - 2);
}

