#include <stdexcept>

boost::any compare_one(boost::any a, boost::any b) {
    double a_val, b_val;

    // Convert string inputs to double, handling both '.' and ',' as decimal points
    if (a.type() == typeid(std::string)) {
        std::string a_str = boost::any_cast<std::string>(a);
        a_val = std::stod(a_str.replace(a_str.find(','), 1, "."));
    } else if (a.type() == typeid(int)) {
        a_val = boost::any_cast<int>(a);
    } else if (a.type() == typeid(double)) {
        a_val = boost::any_cast<double>(a);
    } else {
        throw std::invalid_argument("Unsupported type for a");
    }

    if (b.type() == typeid(std::string)) {
        std::string b_str = boost::any_cast<std::string>(b);
        b_val = std::stod(b_str.replace(b_str.find(','), 1, "."));
    } else if (b.type() == typeid(int)) {
        b_val = boost::any_cast<int>(b);
    } else if (b.type() == typeid(double)) {
        b_val = boost::any_cast<double>(b);
    } else {
        throw std::invalid_argument("Unsupported type for b");
    }

    // Compare the values
    if (a_val > b_val) {
        // Return the larger value in its original type
        if (a.type() == typeid(int)) {
            return boost::any_cast<int>(a);
        } else if (a.type() == typeid(double)) {
            return boost::any_cast<double>(a);
        } else {
            return a;
        }
    } else if (a_val < b_val) {
        // Return the larger value in its original type
        if (b.type() == typeid(int)) {
            return boost::any_cast<int>(b);
        } else if (b.type() == typeid(double)) {
            return boost::any_cast<double>(b);
        } else {
            return b;
        }
    } else {
        // Return "None" if the values are equal
        return std::string("None");
    }
}

