int sum_squares(vector<int> lst){
    int result = 0;
    for (int i = 0; i < lst.size(); i++) {
        if (i % 3 == 0) {
            result += lst[i] * lst[i];
        } else if (i % 4 == 0) {
            result += lst[i] * lst[i] * lst[i];
        } else {
            result += lst[i];
        }
    }
    return result;
}

