    long long gcd = result_den;
    long long temp = result_num;
    while (temp!= 0) {
        long long t = temp;
        temp = gcd % temp;
        gcd = t;
    }

    // Check if the denominator of the resulting fraction can be divided by the greatest common divisor to give 1
    return result_den / gcd == 1;
}

