vector<int> order_by_points(vector<int> nums) {
    vector<pair<int, int>> indexed_nums;
    for (int i = 0; i < nums.size(); i++) {
        indexed_nums.push_back({i, nums[i]});
    }

    auto sum_of_digits = [](int n) {
        int sum = 0;
        int sign = (n < 0)? -1 : 1;
        n = abs(n);
        while (n > 0) {
            sum += n % 10;
            n /= 10;
        }
        return sum * sign;
    };

    sort(indexed_nums.begin(), indexed_nums.end(), [&](const pair<int, int>& a, const pair<int, int>& b) {
        int sum_a = sum_of_digits(a.second);
        int sum_b = sum_of_digits(b.second);
        if (sum_a == sum_b) {
            return a.first < b.first;
        }
        return sum_a < sum_b;
    });

    vector<int> result;
    for (const auto& pair : indexed_nums) {
        result.push_back(pair.second);
    }
    return result;
}

