    bool operator()(const pair<int, int>& a, const pair<int, int>& b) {
        int sumA = sum_of_digits(a.first);
        int sumB = sum_of_digits(b.first);
        if (sumA == sumB) {
            return a.second < b.second;
        }
        return sumA < sumB;
    }
};

