    }

    // Sort the vector of pairs using the custom comparator
    sort(indexedNums.begin(), indexedNums.end(), Comparator());

    // Extract the sorted numbers from the vector of pairs
    vector<int> sortedNums;
    for (const auto& pair : indexedNums) {
        sortedNums.push_back(pair.first);
    }

    return sortedNums;
}

