#include<stdio.h>
#include<vector>
using namespace std;

int get_max_triples(int n){
    vector<int> a;
    for (int i = 1; i <= n; i++) {
        a.push_back((i * i - i + 1) % 3);
    }
    int count = 0;
    int count0 = 0, count1 = 0, count2 = 0;
    for (int i = 0; i < n; i++) {
        if (a[i] == 0) count0++;
        else if (a[i] == 1) count1++;
        else count2++;
    }
    count += count0 * (count1 + count2) * (count1 + count2 - 1) / 2;
    count += count1 * count2 * (count2 - 1) / 2;
    count += count0 * (count0 - 1) * (count0 - 2) / 6;
    count += count1 * (count1 - 1) * (count1 - 2) / 6;
    count += count2 * (count2 - 1) * (count2 - 2) / 6;
    return count;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (get_max_triples(5) == 1);
    assert (get_max_triples(6) == 4);
    assert (get_max_triples(10) == 36);
    assert (get_max_triples(100) == 53361);
}

