#include <stdio.h>
#include <vector>
#include <unordered_map>
using namespace std;

int get_max_triples(int n) {
    vector<int> a;
    for (int i = 1; i <= n; i++) {
        a.push_back(i * i - i + 1);
    }
    unordered_map<int, int> remainderCount;
    for (int i = 0; i < n; i++) {
        remainderCount[a[i] % 3]++;
    }
    int count = 0;
    // count the number of triples with sum divisible by 3
    // (0, 0, 0), (1, 1, 1), (2, 2, 2)
    count += remainderCount[0] * (remainderCount[0] - 1) * (remainderCount[0] - 2) / 6;
    count += remainderCount[1] * (remainderCount[1] - 1) * (remainderCount[1] - 2) / 6;
    count += remainderCount[2] * (remainderCount[2] - 1) * (remainderCount[2] - 2) / 6;
    // count the number of triples with sum divisible by 3
    // (0, 1, 2)
    count += remainderCount[0] * remainderCount[1] * remainderCount[2];
    return count;
}

