#include <stdlib.h>
#include <algorithm>
#include <math.h>
#include <stdio.h>
#include <vector>
#include <string>
#include <climits>
#include <cstring>
#include <iostream>
#include <cassert>
#include <bitset>
#include <functional>
#include <cmath>
#include <cstdlib>
#include <queue>
#include <bits/stdc++.h>
using namespace std;

string int_to_mini_roman(int number) {
    int decimal_values[] = {1000, 900, 500, 400, 100, 90, 50, 40, 10, 9, 5, 4, 1};
    string roman_numerals[] = {"m", "cm", "d", "cd", "c", "xc", "l", "xl", "x", "ix", "v", "iv", "i"};
    string result = "";
    for (int i = 0; i < 13; i++) {
        while (number >= decimal_values[i]) {
            result += roman_numerals[i];
            number -= decimal_values[i];
        }
    }
    return result;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (int_to_mini_roman(19) == "xix");
    assert (int_to_mini_roman(152) == "clii");
    assert (int_to_mini_roman(251) == "ccli");
    assert (int_to_mini_roman(426) == "cdxxvi");
    assert (int_to_mini_roman(500) == "d");
    assert (int_to_mini_roman(1) == "i");
    assert (int_to_mini_roman(4) == "iv");
    assert (int_to_mini_roman(43) == "xliii");
    assert (int_to_mini_roman(90) == "xc");
    assert (int_to_mini_roman(94) == "xciv");
    assert (int_to_mini_roman(532) == "dxxxii");
    assert (int_to_mini_roman(900) == "cm");
    assert (int_to_mini_roman(994) == "cmxciv");
    assert (int_to_mini_roman(1000) == "m");
}

