#include <stdexcept>
#include <cmath>

// Function declarations
int evaluateExpression(const std::string& expression, int& pos);
int evaluateTerm(const std::string& expression, int& pos);
int evaluateFactor(const std::string& expression, int& pos);

int do_algebra(const std::vector<std::string>& operato, const std::vector<int>& operand) {
    if (operato.size()!= operand.size() - 1) {
        throw std::invalid_argument("The length of operator vector must be equal to the length of operand vector minus one.");
    }

    std::string expression;
    for (size_t i = 0; i < operand.size(); ++i) {
        expression += std::to_string(operand[i]);
        if (i < operand.size() - 1) {
            expression += operato[i];
        }
    }

    // Evaluate the expression using a simple recursive descent parser
    int pos = 0;
    return evaluateExpression(expression, pos);
}

// Simple recursive descent parser to evaluate the expression
int evaluateExpression(const std::string& expression, int& pos) {
    int result = evaluateTerm(expression, pos);
    while (pos < expression.size() && (expression[pos] == '+' || expression[pos] == '-')) {
        char op = expression[pos++];
        int term = evaluateTerm(expression, pos);
        if (op == '+') {
            result += term;
        } else {
            result -= term;
        }
    }
    return result;
}

int evaluateTerm(const std::string& expression, int& pos) {
    int result = evaluateFactor(expression, pos);
    while (pos < expression.size() && (expression[pos] == '*' || expression[pos] == '/' || expression[pos] == '^')) {
        char op = expression[pos++];
        int factor = evaluateFactor(expression, pos);
        if (op == '*') {
            result *= factor;
        } else if (op == '/') {
            result /= factor;
        } else {
            result = pow(result, factor);
        }
    }
    return result;
}

int evaluateFactor(const std::string& expression, int& pos) {
    int result = 0;
    while (pos < expression.size() && std::isdigit(expression[pos])) {
        result = result * 10 + (expression[pos++] - '0');
    }
    return result;
}

