#include <stdexcept>

int do_algebra(const std::vector<std::string>& operato, const std::vector<int>& operand) {
    if (operato.size()!= operand.size() - 1) {
        throw std::invalid_argument("Invalid input: operator and operand vectors must have compatible sizes");
    }

    std::string expression;
    for (size_t i = 0; i < operand.size(); ++i) {
        expression += std::to_string(operand[i]);
        if (i < operand.size() - 1) {
            expression += operato[i];
        }
    }

    // Evaluate the expression using a simple recursive descent parser
    int result = 0;
    int sign = 1;
    size_t pos = 0;
    while (pos < expression.size()) {
        if (expression[pos] == '+') {
            sign = 1;
            ++pos;
        } else if (expression[pos] == '-') {
            sign = -1;
            ++pos;
        }

        size_t start = pos;
        while (pos < expression.size() && std::isdigit(expression[pos])) {
            ++pos;
        }
        int num = std::stoi(expression.substr(start, pos - start));

        if (pos < expression.size() && expression[pos] == '*') {
            ++pos;
            size_t start = pos;
            while (pos < expression.size() && std::isdigit(expression[pos])) {
                ++pos;
            }
            result += sign * num * std::stoi(expression.substr(start, pos - start));
        } else if (pos < expression.size() && expression[pos] == '/') {
            ++pos;
            size_t start = pos;
            while (pos < expression.size() && std::isdigit(expression[pos])) {
                ++pos;
            }
            result += sign * num / std::stoi(expression.substr(start, pos - start));
        } else if (pos < expression.size() && expression[pos] == '^') {
            ++pos;
            size_t start = pos;
            while (pos < expression.size() && std::isdigit(expression[pos])) {
                ++pos;
            }
            int exponent = std::stoi(expression.substr(start, pos - start));
            result += sign * pow(num, exponent);
        } else {
            result += sign * num;
        }
    }

    return result;
}

