#include <stdio.h>
#include <string>
#include <algorithm>

bool is_palindrome(const std::string& str) {
    // Test if given string is a palindrome
    std::string s(str.rbegin(), str.rend());
    return s == str;
}

std::string make_palindrome(const std::string& str) {
    // Find the shortest palindrome that begins with a supplied string.
    // Algorithm idea is simple: 
    // - Find the longest postfix of supplied string that is a palindrome.
    // - Append to the end of the string reverse of a string prefix that comes before the palindromic suffix.
    if (str.empty()) {
        return "";
    }

    for (int i = str.length(); i > 0; --i) {
        if (is_palindrome(str.substr(i))) {
            std::string prefix = str.substr(0, i);
            std::string reversedPrefix(prefix.rbegin(), prefix.rend());
            return str + reversedPrefix;
        }
    }

    std::string reversedStr(str.rbegin(), str.rend());
    return str + reversedStr;
}

#undef NDEBUG
#include<assert.h>
int main(){
    assert (make_palindrome("") == "");
    assert (make_palindrome("x") == "x");
     assert (make_palindrome("xyz") == "xyzyx");
     assert (make_palindrome("xyx") == "xyx") ;
     assert (make_palindrome("jerry") == "jerryrrej");
}

