double find_zero(const std::vector<double>& xs) {
    // Check if the number of coefficients is even
    if (xs.size() % 2!= 0) {
        throw std::invalid_argument("The number of coefficients must be even");
    }

    // Check if the largest non-zero coefficient is at the end
    if (xs.back() == 0) {
        throw std::invalid_argument("The largest non-zero coefficient must be at the end");
    }

    // Use a simple root finding algorithm (Newton-Raphson method)
    double x = 0; // initial guess
    double epsilon = 1e-6; // tolerance
    double max_iter = 1000; // maximum number of iterations

    for (int i = 0; i < max_iter; i++) {
        double f_x = poly(xs, x);
