        for (int j = 1; j < xs.size(); j++) {
            f_prime_x += j * xs[j] * pow(x, j - 1);
        }

        if (std::abs(f_x) < epsilon) {
            return x;
        }

        x = x - f_x / f_prime_x;
    }

    // If no real root is found, throw an error
    throw std::runtime_error("No real root found");
