// Function to evaluate a polynomial with coefficients xs at point x
double poly(const std::vector<double>& xs, double x) {
    double sum = 0;
    for (int i = 0; i < xs.size(); i++) {
        sum += xs[i] * pow(x, i);
    }
    return sum;
}

// Function to find a zero of the polynomial with coefficients xs
double find_zero(const std::vector<double>& xs) {
    // Use the quadratic formula to find the roots of the polynomial
    // This assumes that the polynomial is quadratic (i.e., has degree 2)
    if (xs.size() == 3) {
        double a = xs[2];
        double b = xs[1];
        double c = xs[0];
        double discriminant = b * b - 4 * a * c;
        if (discriminant >= 0) {
            double root = (-b + sqrt(discriminant)) / (2 * a);
            return root;
        } else {
            // If the discriminant is negative, the polynomial has no real roots
            // In this case, we return the real part of the first complex root
            std::complex<double> root = (-b + sqrt(std::complex<double>(discriminant))) / (2 * a);
            return root.real();
        }
    } else {
        // For polynomials of degree greater than 2, we use a numerical method to find a root
        // Here, we use the Newton-Raphson method
        double x = 0; // Initial guess for the root
        double tolerance = 1e-6; // Tolerance for convergence
        double maxIterations = 100; // Maximum number of iterations
        for (int i = 0; i < maxIterations; i++) {
            double f_x = poly(xs, x);
            double f_prime_x = 0;
            for (int j = 1; j < xs.size(); j++) {
                f_prime_x += j * xs[j] * pow(x, j - 1);
            }
            double x_new = x - f_x / f_prime_x;
            if (abs(x_new - x) < tolerance) {
                return x_new;
            }
            x = x_new;
        }
        // If the Newton-Raphson method fails to converge, return an error value
        return std::numeric_limits<double>::quiet_NaN();
    }
}


