double poly(const std::vector<double>& xs, double x) {
    double sum = 0;
    for (int i = 0; i < xs.size(); i++) {
        sum += xs[i] * pow(x, i);
    }
    return sum;
}

double find_zero(const std::vector<double>& xs) {
    // Use the quadratic formula to find the roots of the polynomial
    // This assumes that the polynomial is quadratic (i.e., it has degree 2)
    // If the polynomial has a higher degree, you would need to use a more complex method
    // such as the Jenkins-Traub algorithm or a numerical method like Newton's method
    if (xs.size()!= 3) {
        throw std::invalid_argument("Polynomial must be quadratic");
    }

    double a = xs[2];
    double b = xs[1];
    double c = xs[0];

    double discriminant = b * b - 4 * a * c;

    if (discriminant < 0) {
        // The polynomial has no real roots
        throw std::runtime_error("Polynomial has no real roots");
    }

    double root1 = (-b + sqrt(discriminant)) / (2 * a);
    double root2 = (-b - sqrt(discriminant)) / (2 * a);

    // Return the smaller root
    return std::min(root1, root2);
}

// For polynomials of higher degree, you can use a numerical method like Newton's method
double find_zero_higher_degree(const std::vector<double>& xs) {
    double x = 0; // Initial guess
    double tolerance = 1e-6; // Tolerance for convergence
    double max_iterations = 1000; // Maximum number of iterations

    for (int i = 0; i < max_iterations; i++) {
        double f_x = poly(xs, x);
        double f_prime_x = 0;
        for (int j = 1; j < xs.size(); j++) {
            f_prime_x += j * xs[j] * pow(x, j - 1);
        }

        double x_new = x - f_x / f_prime_x;

        if (std::abs(x_new - x) < tolerance) {
            return x_new;
        }

        x = x_new;
    }

    throw std::runtime_error("Failed to converge");
}

